import AddBoxIcon from '@mui/icons-material/AddBox';
import React from 'react'
import { useDispatch } from "react-redux";

const Footer = () => {
    const dispatch = useDispatch();

  const AddTask = () => { 
    dispatch()
  }


  return (
    <Container>
        <TextField/>
      <AddBoxIcon onClick={()=> AddTask}/>
    </Container>
  )
}

export default Footer
